import React, { useEffect, useState } from "react";
import axios from 'axios';

function RegistrationForm() {
  const [registerInfo, setRegisterInfo] = useState({
    Marks: '',
    Percentile: '',
    Cast: ''
  });
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setRegisterInfo({
      ...registerInfo,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { Marks, Percentile, Cast } = registerInfo;
    if (!Marks || !Percentile || !Cast) {
      setError('All fields are required');
      return;
    }
    try {
      const url = 'http://localhost:8080/shreyapp/register';
      const res = await axios.post(url, registerInfo, {
        headers: {
          'Content-Type': 'application/json'
        }
      });
      console.log(res.data);
    } catch (error) {
      setError(error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>Marks:</label>
      <input type="text" name="Marks" value={registerInfo.Marks} onChange={handleChange} />
      <br />
      <label>Percentile:</label>
      <input type="text" name="Percentile" value={registerInfo.Percentile} onChange={handleChange} />
      <br />
      <label>Cast:</label>
      <input type="text" name="Cast" value={registerInfo.Cast} onChange={handleChange} />
      <br />
      <button type="submit">Register</button>
      {error && <p style={{ color: 'red' }}>{error}</p>}
    </form>
  );
}

export default RegistrationForm;
